import { Box, Container, Grid2, Typography, colors } from "@mui/material";
import React from "react";
import styled from "styled-components";
import Input from "../../component/Input";
import { BorderAll } from "@mui/icons-material";



const FooterBox= styled(Box)`
    background-color: black;
    padding: 30px 0px 30px 0px;
    position: relative;
    top: 333px;
`

const FooterInput =styled(Box)`
        border: 1px solid white;
    width: 160px;
    height: 40px;
    margin-top: 16px;


`



export default function Footer (){
    return<>
    <FooterBox>
        <Container>
            <Grid2 container>
                <Grid2  size={3}>
                    <Box>
                        <Typography variant="h4" sx={{color:"white"}}>
                            Exclisive

                        </Typography>
                        <Typography variant="h6" sx={{color:"white"}}>
                            Subscribe

                        </Typography>
                        <Typography variant="subtitle2" sx={{color:"white"}}>
                            Get 10% off your first order

                        </Typography>
                        <FooterInput>
                        <Input type="email" label="Enter your email" name="emailfooter" variant="filled" 
                        style={{
                               // Target the Filled Input root element
        "& .MuiFilledInput-root": {
            backgroundColor: "#f3f3f3", // Default background color
            "&:hover": {
              backgroundColor: "#e0e0e0", // Background color on hover
              border: "none", // Remove the border on hover
            },
          },
          // Remove the underline on hover for the filled variant
          "& .MuiFilledInput-underline:before": {
            borderBottom: "none", // No border when hovered
          },
          "& .MuiFilledInput-underline:hover:before": {
            borderBottom: "none", // Ensure the underline doesn't show on hover
          },
          // Label color and boldness when hovered
          "& .MuiInputLabel-root": {
            color: "#da1919", // Default label color
            fontWeight: "bold", // Default label boldness
          },
          "& .MuiInputLabel-root.Mui-focused": {
            color: "#ff4081", // Label color when input is focused
          },
        }}



                   ></Input>
                        </FooterInput>
                    </Box>

                </Grid2>

            </Grid2>

        </Container>
    </FooterBox>



    </>
}
